import axios from "axios";
import React from "react";
import useInput from "../hooks/Useimput";
import { useNavigate } from "react-router";
const Register = () => {
  const name = useInput();
  const email = useInput();
  const password = useInput();
const navigate = useNavigate()
  const handlerSumit = (e) => {
    e.preventDefault();
    axios.post("http://localhost:1337/api/users/register", {
      name: name.value,
      email: email.value,
      password: password.value,
    })
    navigate('/Slider');
  };
  return (
    <form onSubmit={handlerSumit}>
      <div class="mb-3">
        <label for="validationCustom0" class="form-label">
          Name
        </label>
        <input
          {...name}
          type="text"
          class="form-control"
          id="exampleInputEmail1"
          aria-describedby="emailHelp"
        />
      </div>
      <div class="mb-3">
        <label for="exampleInputEmail1" class="form-label">
          Email address
        </label>
        <input
          {...email}
          type="email"
          class="form-control"
          id="exampleInputEmail1"
          aria-describedby="emailHelp"
          placeholder="Well never share your email with anyone else"
        />
      </div>
      <div class="mb-3">
        <label for="exampleInputPassword1" class="form-label">
          Password
        </label>
        <input
          {...password}
          type="password"
          class="form-control"
          id="exampleInputPassword1"
        />
      </div>
      <div class="mb-3 form-check">
        <input type="checkbox" class="form-check-input" id="exampleCheck1" />
        <label class="form-check-label" for="exampleCheck1">
          Check me out
        </label>
      </div>
      <button type="submit" class="btn btn-primary">
        Submit
      </button>
    </form>
  );
};

export default Register;
